export interface Product {
  _id?: string;
  title?: string;
  description?: string;
  brand?: string;
  countStock?:number;
  thumbnail?:string;
  images?: string;
  rating?: number;
  isFeatured?: boolean;
  content?:string;
  price?:number;
  category?:string;
  created_at?:Date;
  updated_at?:Date;

}

export interface ResProduct {
  success?: boolean;
  products: Product[]
}

export interface ResOneProduct {
  success?: boolean;
  category: Product;
}
